def make_table():
	f = open("data/chinese_poetry.txt", "r")
	txt = f.read()
	allsounds = set()
	for c in tqdm.tqdm(txt):
		res = pinyin(c, style=Style.BOPOMOFO)[0][0]
		allsounds.add(res)

	f = open("data/chinese_word.txt", "r")
	txt = f.read()
	allsounds = set()
	for c in tqdm.tqdm(txt):
		res = pinyin(c, style=Style.BOPOMOFO)[0][0]
		if(res  == c):
			continue
		allsounds.add(res)
	allsounds = sorted(allsounds)
	s = '['
	for x in allsounds:
		s += "'"  + x + "'" + ','
	s += ']'
	print(s)

def make_ind():
	cnt = 0

	s = '{'
	for x in table:
		s += "'" + x + "'" + ": " + str(cnt) + ","
		cnt = cnt + 1
	s += '}'
	print(s)

